Quarto dia em Oração - porque temer se Deus está conosco ?
Oração : 

Sennhor Deus estamos no quarto dia em Oração para te pedir que perserveremos na fé, que nunca nos desviemos do teu Santo caminho, Senhor para serguirmos em frente precisamos de ti e sempre sinto e quero sempre sentir a tua Santa presença, que nestes dias de Oração sejam abençoadas, Senhor confesso que tenho medo de muitas coisas, mas tu Senhor Deus me fortalece, me dar Senhor forças para seguir em frente, tu és tão lindo! Obrigado por tudo! Seja feita a tua vontade! Amém! 

*refletindo a palavra 

Isaías cap 41 vers 13 

Irmãos e irmãs estamos no quarto dia em Oração - quero ser perserverante na fé! E nesta leitura biblica fala sobre o temer, medo, a misericordia de Deus, a " ajuda " de Deus, em todas as dificuldades Deus nos diz: " não temas, que eu te ajudo ", quando choramos Deus nos diz: " não temas eu enchugarei tuas lagrimas ", nesta leitura biblica também nos mostra, nos diz sobre o infinito amor de Deus! O caminho do Senhor é tão lindo, porque Deus nos ama tanto que morreu na cruz por nós! E na cruz ele demonstrou esse infinito amor , mostrou a misericordia dele quando Jesus perdoa o bom ladrão, esse ladrão ele se arrempendeu é como se ele estivesse pedindo misericordia, e, Jesus teve misericordia dele ( lucas cap 23 vers 42, 43 ). Em lucas cap 23 vers 40 ao 43 , no vers 40 o bom ladrão se reconhece pecador , vers 41 reconhece Deus como Senhor dele, é como ele estivesse falando que ele é Deus verdadeiro, como também o centurião reconheceu que ele é Justo! ( em lucas cap 23 vers 47 ), e em lucas cap 23 vers 43, Jesus que perdoa o bom ladrão, e Jesus teve misericordia dele ( do bom ladrão )! que nós tambem possamos nos reconhecer pecadores e pedir perdão! Rezemos, Oremos a Oracão que Nosso Senhor Jesus Cristo nos ensinou : 

Pai nosso ...

Ofereça! 

Espero que tenham gostado !

